import KotlinPlayground from "react-kotlin-playground";
import {useState} from 'react'

const Test = ({html, handleHtmlChange}) => {
    const [value, setValue] = useState(html);
    return (
        <KotlinPlayground mode="kotlin" targetPlatform='js'>
        <pre>
          <code>

                <textarea value={html} onChange={(e) => {handleHtmlChange(e); setValue(() => e.target.value)}}></textarea>

          </code>
        </pre>
      </KotlinPlayground>
    )
}

export default Test;
